import React, { useState } from "react";
import "../App.css";
import Parse from "parse";

//COMPONENTS
import LiveChat from "./LiveChat";

export default function ChatSetup(props) {
  return (
    <div>
      {chatRoom === undefined ||
        (chatRoom === null && <h1> chat setup ...</h1>)}

      {chatRoom !== undefined && chatRoom !== null && (
        <div>
          <h1>Messages </h1>
          <LiveChat chatRoom={chatRoom} selectedUser={props.selectedUser} />
        </div>
      )}
    </div>
  );
}
